import React, { Component } from 'react';
import './css/main.css';
import './css/fontawesome.css';

import NAV from './nav';
import TOPNAV from './topnav';

export class adminIndex extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div id="wrapper">
                <NAV></NAV>
                <div id="content-wrapper" class="d-flex flex-column">

                </div>
            </div>
        );
    }
}
